public String getOriginalTrackingUrl() {
  ApplicationAttemptReportProtoOrBuilder p = viaProto ? proto : builder;
  if (!p.hasOriginalTrackingUrl()) {
    return null;
  }
  return p.getOriginalTrackingUrl();
}
